import './App.css';

import Form from './components/Form/Form';
import TodoList from './components/TodoList/TodoList';

import axios from 'axios';

const getAllTodo = async () => {
  var todoList = [];
  await axios('todo/', {
      method: "GET",
  }).then((res) => {
      todoList = res.data;
  }).catch((err) => {
      console.log(err.message);
  });
  return todoList;
}

const dummyTodos = [
  { name: "Go to the market" },
  { name: "Learn MERN stack" },
  { name: "Ride bike!" }];

function App() {
  return (
    <div className="App">
        <Form/>
        <TodoList todoList={dummyTodos}/>
    </div>
  );
}

export default App;
